import React from 'react';
import {BrowserRouter, Route} from 'react-router-dom';

import TopBar from './TopBar';
import InspireMe from './InspireMe';
import '../css/App.css';

const App = () => {
  return (
    <div>
      <div className="header">
        <TopBar />
      </div>
      <BrowserRouter>
        <div>
        <Route path="/" />
        <Route path="/inspireme" component={InspireMe} />
        </div>
      </BrowserRouter>
    </div>

  );
};

export default App;
